import React from 'react';

class InputText extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            text: ''
        }
      }

      chageText = (e) => {
        this.setState({ text: e})      

    }

    render() {
        return (
            <div>
                <input type="text" onKeyUp={this.chageText}/><br />
                {this.state.text}
            </div>
        )

    }
}

export default InputText;
